import React from "react";
import './searchbar.css';
import { Link } from "react-router-dom";

function Header() {
  return (
    <div className="header">
      <div>
        <div className="logo"><Link to="/">9G9J</Link></div>
      </div>
      <div className="container">
        <form className="search-bar">
          <input type="text" placeholder="Search movie..." name="q"></input>
          <button className="search-button"><i class="fa-solid fa-magnifying-glass"></i></button>
        </form>
      </div>
      <div className="navbar">
          <div><Link to="/reviews">Reviews</Link></div>
          <div><Link to="/signup">Register</Link></div>
          <div><Link to="/signin">Login</Link></div>
      </div>
    </div>

  )
}

export default Header;
